import React from "react";
import Props from "./props";
import Api from "./api";

let Comp2=()=>{
    return(
        <>
     <Props
          key={Api[0].id}
          img={Api[0].img}
        title={Api[0].title}
   />
        </>
    )
}
export default Comp2;
